        paddingVertical: 10,
        fontSize: 16,
    },

    image: {
        width: 400,
        height:800,
        alignItems: 'center',
        borderRadius: 100,
        marginTop: 110
    },

    main: {
        flex: 1,
        alignItems: 'center'
    },

    main2: {
        flex: 1,
        alignItems: 'center'
    },

    title: {
